import "./Hero.css";
import Design from "../Desing/Design";
const Hero = () => {
  return (
    // <div
    //   className="hero"
    //   style={{
    //     position: "relative",
    //   }}
    // >
    <>
      <Design />

      <div
        className="hero"
        style={{
          position: "absolute",
        }}
      >
        <img src="./img/per.png" alt="" />
        <h1>
          <span>I'm Adib Kazi ,</span> frontend devloper based in pune
        </h1>
        <p>
          I am a frontend devloper from pune,Maharastra with 1 year of
          experience.
        </p>
        <div className="hero-action">
          <div className="hero-connect">Connect With Me</div>
          <div className="hero-resme">My resume</div>
        </div>
      </div>
      </>    // </div>
  );
};

export default Hero;
